import React from "react";
import perfect from "../assets/perfect.png";
import search from "../assets/search.png";
import share from "../assets/share.png";
import styled from "styled-components";

const Conatiner = styled.div`
    width:100%
    height: 250vh;
    background-color: white;
}`;

const Left = styled.div`
  width: 50%;
  margin: 30px;
  padding: 35px;
  h1 {
    font-size: 2rem;
    font-weight: 600;
  }
  p {
    font-size: 1.5rem;
    margin-left: 15px;
  }
`;

const Right = styled.div`
  width: 50%;
  margin: 30px;
  padding: 50px;
  img {
    padding-right: 0;
    margin-right: -10px;
    right: 0;
  }
  h1 {
    font-size: 2rem;
    font-weight: 600;
  }
  p {
    font-size: 1.5rem;
    margin-leftt: 15px;
  }
`;

const Row = styled.div`
  tex-align: center;
  justify-between: space-between;
  display: flex;
  align-items: center;
  max-width: 1100px;
  padding: 30px;
  margin-left: 40px;
`;

const Howitworks = () => {
  return (
    <>
      <Conatiner>
        <Row>
          <Left>
            <h1>Struck Ups, Facing issues Need Help?</h1>
            <p>The right place is here, Search here for right person.</p>
          </Left>
          <Right>
            <img src={search}></img>
          </Right>
        </Row>
        <Row>
          <Left>
            <img src={perfect}></img>
          </Left>
          <Right>
            <h1> Look for the best one!</h1>
            <p> Find the perfect and wonderful matches.</p>
          </Right>
        </Row>
        <Row>
          <Left>
            <h1>Start sharing and get your needs!</h1>
            <p>Start Working together and do it quickly with sharing mind.</p>
          </Left>
          <Right>
            <img src={share}></img>
          </Right>
        </Row>
      </Conatiner>
    </>
  );
};

export default Howitworks;
